import Header from "../Header";
import { useState } from "react";
import { useEffect } from "react";
import RoomsData from "../data/RoomsData";

export default function BookingPage(){


    return (
        <div>
            <Header/>
            <div className="flex">
                <div>
                Check-in
                </div>
                <div>
                Check-out
                </div>
                <button>
                Availability
                </button>
            </div>
        </div>
    )
}
